import { createTheme } from '@mui/material';
import { cyan, indigo } from '@mui/material/colors';

export const LightTheme = createTheme({
  palette: {
    primary: {
      main: '#0d3b66',
      dark: indigo[800],
      light: indigo[500],
      contrastText: '#000',
    },
    secondary: {
      main: cyan[400],
      dark: cyan[400],
      light: cyan[300],
      contrastText: '#ffffff',
    },
    background: {
      default: 'rgb(250,240,202)',
      paper: '#ffffff',
    },
  },
});
